            _id: newUser.id,
            name: newUser.name,
            email: newUser.email,
            isAdmin: newUser.isAdmin,
            token: getToken(newUser)
        })
    }
    else{
        res.status(404).send({ msg:'Invalid User Data.'})
    }
})


